import classes from "./Title.module.css";

function Title() {
  return (
    <div className={classes.parent}>
      <div className={classes.title}>
        {/* <div className={classes.child}></div> */}
        <img src="Group.jpg" style={{ height: "90vh", width: "200vh" }} />
      </div>
    </div>
  );
}

export default Title;
